import React from 'react'; // import the React library
import './index.css';

const Title = () => {
    return (
        <div>
            <h2>Jay Luo</h2>
            <ol>
                <li>Item1</li>
                <li>Item2</li>
                <li>Item3</li>
            </ol>
        </div>
    )
} 
export default Title;
